database = list()
with open("26_20815.txt") as f:
    fdata = f.readline().strip()
    kandidats,mesta = fdata.split()
    fdata = f.readline().strip()
    while fdata !="":
        ID,a1,a2,a3,sobec = fdata.split()
        balls = int(a1)+int(a2)+int(a3)

        database.append((balls,int(sobec),-int(ID)))
        fdata = f.readline().strip()


database.sort(reverse=True)


search = database[int(mesta)-1][0]
ans = database[int(mesta)-1][2]
find = list()
for x in range(int(mesta),len(database)):
    find.append(database[x][0])
c = 0
for x in find:
    if x == search:
        c+=1
print(ans,c)

